import react, { useState } from 'react';

const Main = () => {
  const [formData, setFormData] = useState({
    artist: '',
    album: '',
    track: '',
    startTimestamp: '',
    endTimestamp: '',
  });

    const handleChange = (e: React.ChangeEvent<HTMLInputElement>) => {
        const { name, value } = e.target;
        setFormData(prevState => ({
            ...prevState,
            [name]: value,
        }));
    };

    const handleSubmit = (e: React.FormEvent<HTMLFormElement>) => {
        e.preventDefault();
        console.log(formData);
        // Implement the submission logic here
    };


  return (
    <section>
      <form onSubmit={handleSubmit}>
        <table>
          <tbody>
            <tr>
              <th><label htmlFor="artist">Artist</label></th>
              <td><input id="artist" name="artist" type="text" value={formData.artist} onChange={handleChange} /></td>
            </tr>
            <tr>
              <th><label htmlFor="album">Album</label></th>
              <td><input id="album" name="album" type="text" value={formData.album} onChange={handleChange} /></td>
            </tr>
            <tr>
              <th><label htmlFor="track">Track</label></th>
              <td><input id="track" name="track" type="text" value={formData.track} onChange={handleChange} /></td>
            </tr>
            <tr>
              <th><label htmlFor="startTimestamp">Start Time</label></th>
              <td><input id="startTimestamp" name="startTimestamp" type="datetime-local" value={formData.startTimestamp} onChange={handleChange} /></td>
            </tr>
            <tr>
              <th><label htmlFor="endTimestamp">End Time</label></th>
              <td><input id="endTimestamp" name="endTimestamp" type="datetime-local" value={formData.endTimestamp} onChange={handleChange} /></td>
            </tr>
            <tr>
              <th></th>
              <td>
                <button type="button" id="test">Test</button>
                <button type="submit">Generate</button>
              </td>
            </tr>
          </tbody>
        </table>
      </form>
      <div id="results">
        {/* Results or feedback can be displayed here */}
      </div>
    </section>
  );
};

export default Main;
